import React, { useState } from 'react';

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [noPosition, setNoPosition] = useState({ x: 0, y: 0 });
  const [answered, setAnswered] = useState(false);

  const noTexts = [
    "No",
    "Are you sure?",
    "Really?",
    "Think again!",
    "Don't be shy...",
    "Pretty please?",
    "Just click Yes!",
    "You know you want to...",
    "Last chance!",
    "Nope! Click Yes!",
    "I won't give up!",
    "Come on...",
    "Please? ü•∫"
  ];

  const handleNoHover = () => {
    setNoCount(prev => prev + 1);

    // Smoother, cuter movement - stays within reasonable bounds
    const maxX = 200;
    const maxY = 150;
    const newX = (Math.random() - 0.5) * maxX;
    const newY = (Math.random() - 0.5) * maxY;

    setNoPosition({ x: newX, y: newY });
  };

  const handleYes = () => {
    setAnswered(true);
  };

  if (answered) {
    return (
      <div style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #ffe5e5 0%, #ffcccc 50%, #ffb3b3 100%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Fredoka", "Comic Sans MS", cursive',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {/* Floating hearts */}
        {[...Array(20)].map((_, i) => (
          <div
            key={i}
            style={{
              position: 'absolute',
              fontSize: `${Math.random() * 30 + 20}px`,
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              animation: `float ${Math.random() * 3 + 4}s ease-in-out infinite`,
              animationDelay: `${Math.random() * 2}s`,
              opacity: 0.7
            }}
          >
            {['‚ù§Ô∏è', 'üíï', 'üíñ', 'üíó', 'üåπ'][Math.floor(Math.random() * 5)]}
          </div>
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Fredoka:wght@400;600;700&display=swap');

          @keyframes float {
            0%, 100% { transform: translateY(0px) rotate(0deg); }
            50% { transform: translateY(-25px) rotate(10deg); }
          }
          @keyframes bounceIn {
            0% { transform: scale(0) rotate(-180deg); opacity: 0; }
            50% { transform: scale(1.15) rotate(10deg); }
            100% { transform: scale(1) rotate(0deg); opacity: 1; }
          }
          @keyframes sparkle {
            0%, 100% { opacity: 0.4; transform: scale(0.9); }
            50% { opacity: 1; transform: scale(1.1); }
          }
          @keyframes confetti {
            0% { transform: translateY(-100vh) rotate(0deg); opacity: 1; }
            100% { transform: translateY(100vh) rotate(720deg); opacity: 0; }
          }
        `}</style>

        {/* Confetti effect */}
        {[...Array(30)].map((_, i) => (
          <div
            key={`confetti-${i}`}
            style={{
              position: 'absolute',
              left: `${Math.random() * 100}%`,
              top: '-10%',
              fontSize: '30px',
              animation: `confetti ${Math.random() * 2 + 3}s linear infinite`,
              animationDelay: `${Math.random() * 2}s`,
            }}
          >
            {['‚ù§Ô∏è', 'üíï', 'üéâ', '‚ú®', 'üíñ', 'üåπ'][Math.floor(Math.random() * 6)]}
          </div>
        ))}

        <div style={{
          textAlign: 'center',
          background: 'white',
          padding: '60px 80px',
          borderRadius: '40px',
          boxShadow: '0 25px 70px rgba(220, 20, 60, 0.4)',
          animation: 'bounceIn 0.8s ease-out',
          position: 'relative',
          zIndex: 10,
          border: '5px solid #ff6b6b'
        }}>
          <div style={{ fontSize: '90px', marginBottom: '25px', animation: 'sparkle 1.5s ease-in-out infinite' }}>
            üéâüíï‚ú®
          </div>
          <h1 style={{
            fontSize: '60px',
            background: 'linear-gradient(135deg, #dc143c, #ff0000, #ff4444)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            marginBottom: '20px',
            fontWeight: 800,
            letterSpacing: '-1px'
          }}>
            Yay! Good Boy! üéä
          </h1>
          <p style={{
            fontSize: '30px',
            color: '#dc143c',
            marginTop: '30px',
            fontWeight: 600
          }}>
            I knew you'd say yes! üíñ
          </p>
          <div style={{ fontSize: '55px', marginTop: '25px' }}>
            üòäüíùüåπ
          </div>
        </div>
      </div>
    );
  }

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #fff5f5 0%, #ffe0e0 50%, #ffd0d0 100%)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily: '"Fredoka", "Comic Sans MS", cursive',
      position: 'relative',
      overflow: 'hidden',
      padding: '20px'
    }}>
      {/* Cute decorative elements */}
      <div style={{
        position: 'absolute',
        top: '10%',
        left: '10%',
        fontSize: '65px',
        animation: 'float 3s ease-in-out infinite',
        opacity: 0.8
      }}>
        üíï
      </div>
      <div style={{
        position: 'absolute',
        top: '20%',
        right: '15%',
        fontSize: '55px',
        animation: 'float 4s ease-in-out infinite',
        animationDelay: '1s',
        opacity: 0.8
      }}>
        üåπ
      </div>
      <div style={{
        position: 'absolute',
        bottom: '15%',
        left: '8%',
        fontSize: '60px',
        animation: 'float 3.5s ease-in-out infinite',
        animationDelay: '0.5s',
        opacity: 0.8
      }}>
        ‚ù§Ô∏è
      </div>
      <div style={{
        position: 'absolute',
        bottom: '25%',
        right: '10%',
        fontSize: '55px',
        animation: 'float 4.5s ease-in-out infinite',
        animationDelay: '2s',
        opacity: 0.8
      }}>
        ‚ú®
